pragma solidity >=0.5.0;

contract MaterialsProvider {
  int public controller = 1;
  int public shafts = 1;
  int public doors = 0;
  int public buttons = 0;
  int public displays = 0;
  int public speakers = 0;

  function setController(int x) public {
    controller = x;
  }

  function setShafts(int x) public {
    shafts = x;
  }

  function setDoors(int x) public {
    doors = x;
  }

  function setButtons(int x) public {
    buttons = x;
  }
  function setDisplays(int x) public {
    displays = x;
  }
  function setSpeakers(int x) public {
    speakers = x;
  }
}
